  true,\n\t\"url\": null,\n\t\"notes\": \"The Combined Heat & Power (CHP) Installation
  Database contains information about all the known CHP installations across the country.
  This data is compiled through a variety of sources and is the only known data set
  of its kind. DOE, in partnership with the Oak Ridge National Laboratory and ICF
  International, will be releasing the non-confidential data from this database, including
  the CHP system's city, industry NAICS code, MW capacity, fuel, prime mover technology,
  initial operating year, and servicing electric utility.\",\n\t\"license_title\":
